import {connect} from 'react-redux'

const MovieList = (props)=> {
    return (
        <div>
            <h1>MovieList</h1>
            {
                props.list.map((item, i) => {
                    return (
                        <div key = {i}>
                            {item.title}
                            <button>details</button>
                        </div>
                    )
                })
            }
        </div>
    )
}

const mapStateToProps = (state) => {
    return {
        list: state.movieList
    }
}

export default connect(mapStateToProps)(MovieList)
